import * as React from 'react';

import './style.css';

type MovieProps = {
    id: number
    image: string;
    name: string;
};
export function Movie({ id, image, name }: MovieProps) {
    const path = `"http://localhost/movies/movie?id=${id}"`;
    return (
        <div>
            <a className='Movie' href={path}>
                <div>
                    <img src={image} list-src={image} alt={name}></img>
                </div>
                <div>
                    {name}
                </div>
            </a>
        </div>
    );
}

